import { Tooltip } from "@mui/material";
import { getPlayerHeadByName, getUUID } from "mojang-minecraft-api/lib";

function PlayerList(props: {playerName: string;}){
    let playerImage: any = getPlayerHeadByName(props.playerName);

    return (
        <div className="playertab">
            <div className="playertab-icon"><img src={playerImage} /></div>
            <Tooltip title={playerUUID}>
                <div className="playertab-playername">{props.playerName}</div>
            </Tooltip>
        </div>
    );
}
export default PlayerList;
